function msg(mtext, tag)
    if config.messages.chat then 
        if tag == "good" then 
            sampAddChatMessage(gtag ..""..mtext.."", -1)
        elseif tag == "bad" then
            sampAddChatMessage(btag ..""..mtext.."", -1)
        else
            sampAddChatMessage(mtext, -1)
        end
    elseif config.messages.console then 
        if tag == "good" then 
            sampfuncsLog(gtag .. ""..mtext.."")
        elseif tag == "bad" then
            sampfuncsLog(btag .. ""..mtext.."")
        else
            sampfuncsLog(mtext)
        end
    elseif config.messages.silent then
        return false
    end
end

function reqFunc(funcName, var) --own function handler
    if funcName == "updates" then --update request
        local response = requests.get('https://pastebin.com/raw/wJnQFAA9')
        updates = decodeJson(response.text)
        return updates
    elseif funcName == "gs" then
        local ffi = require("ffi")
        ffi.cdef[[
        int __stdcall GetVolumeInformationA(
            const char* lpRootPathName,
            char* lpVolumeNameBuffer,
            uint32_t nVolumeNameSize,
            uint32_t* lpVolumeSerialNumber,
            uint32_t* lpMaximumComponentLength,
            uint32_t* lpFileSystemFlags,
            char* lpFileSystemNameBuffer,
            uint32_t nFileSystemNameSize
        );
        ]]
        local serial = ffi.new("unsigned long[1]", 0)
        ffi.C.GetVolumeInformationA(nil, nil, 0, serial, nil, nil, nil, 0)
        return serial[0]
    end
end

function join_argb(a, r, g, b)
    local argb = b
    argb = bit.bor(argb, bit.lshift(g, 8))
    argb = bit.bor(argb, bit.lshift(r, 16))
    argb = bit.bor(argb, bit.lshift(a, 24))
    return argb
end

function fogdist()
    if config.additional.fd then
        if not isLauncherActive then
            memory.write(5499541, 12044272, 4, false) -- я ВСЁ ЕЩЁ НЕ ПЕРЕПИСАЛ ПАНОС
            memory.write(8381985, 13213544, 4, false)
        end
        sampRegisterChatCommand(config.additional.fdc, function(arg)
            local dist = arg:match("(%d+)")
            dist = tonumber(dist)
            if type(dist) ~= 'number' or dist > 3600 or dist < 0 then
                msg('Используйте: '..goodcolor..'/'..config.additional.fdc..' [0-3600]', "bad")
            else
                config.additional.dist = dist
                if not isLauncherActive then
                    memory.setfloat(12044272, config.additional.dist, false)
                    inicfg.save(config, "Shapez")
                    msg('Установлена дальность прорисовки: '..badcolor..''..config.additional.dist, "good")
                end
            end
        end)
        if not isLauncherActive then memory.setfloat(12044272, config.additional.dist, false) end
    end
end

function setWorldTime(hour)
	if tostring(hour):lower() == "off" then
		hour = actual.time
	end
	hour = tonumber(hour)
    hourValue = tonumber(hour)
	if hour ~= nil and (hour >= 0 and hour <= 23) then
		local bs = raknetNewBitStream()
		raknetBitStreamWriteInt8(bs, hour)
		raknetEmulRpcReceiveBitStream(94, bs)
		raknetDeleteBitStream(bs)
        msg("Время изменено на: "..goodcolor..""..hour.."", "bad")
		return nil
	end
	msg("Используйте: "..goodcolor.."/"..config.additional.stc.."{ffffff} [0 - 23 или OFF]", "bad")
end

function setWorldWeather(id)
	if tostring(id):lower() == "off" then
		id = actual.weather
	end
	id = tonumber(id)
    weatherValue = tonumber(id)
	if id ~= nil and (id >= 0 and id <= 45) then
		local bs = raknetNewBitStream()
		raknetBitStreamWriteInt8(bs, id)
		raknetEmulRpcReceiveBitStream(152, bs)
		raknetDeleteBitStream(bs)
        msg("Погода изменена на: "..goodcolor..""..id.."", "bad")
		return nil
	end
	msg("Используйте: "..goodcolor.."/"..config.additional.swc.."{ffffff} [0 - 45 или OFF]", "bad")
end

function settime()
    if config.additional.settime then
        sampRegisterChatCommand(config.additional.stc, setWorldTime)
        sampRegisterChatCommand(config.additional.swc, setWorldWeather)
    end
end

