function beforeLoad()
    reqFunc("updates")
    ip, port = sampGetCurrentServerAddress()
    if thisScript().filename ~= 'Shapez.lua' then os.rename(getGameDirectory() .. "/moonloader/" .. thisScript().filename, getGameDirectory() .. "/moonloader/Shapez.lua") end
    if tonumber(updates.info["version_n"]) > version_n and config.customization.disableautoupdate == false then
        oldVersion = true
        msg("Есть обновление! Версия: " .. updates.info["version"], "good")
        msg("Что бы узнать больше, откройте меню скрипта", "good")
    end
end

function main()
    while not isSampAvailable() do wait(0) end
    renderTimeFont = renderCreateFont(config.additional.timeFont, config.additional.timeSize, config.additional.timeStyle)
    colorOfTime = join_argb(255, config.additional.timeR, config.additional.timeG, config.additional.timeB)
    beforeLoad()
    if config.additional.fd then 
        fogdist() 
    end
    if config.additional.settime then
        settime()
    end
    trainbuff = hotkey.RegisterHotKey('trainbuff', false, decodeJson(config.additional.captrainkey), function()
        lua_thread.create(function()
            if not sampIsCursorActive() and isPlayerPlaying(PLAYER_PED) then
                if config.additional.captrain then
                    if config.additional.customizeddelay then
                        wait(math.random() * (340 - 40) + 40)
                        showCaptcha()
                    else
                        wait(34)
                        showCaptcha()
                    end
                end
            end
        end)
    end)
    hotkey.Text.WaitForKey = u8'Waiting for key...'
    msg('Loaded! Author: '..goodcolor..''..author..'{ffffff}. Version: '..goodcolor..''..version..'{ffffff}, activation: '..goodcolor..'F12.', "bad")
    addEventHandler('onWindowMessage', function(var_msg, wparam, lparam)
        if var_msg == wm.WM_KEYDOWN or var_msg == wm.WM_SYSKEYDOWN then
            if wparam == vkeys.VK_F12 then
                renderWindow[0] = not renderWindow[0]
            end
        end
        if var_msg == 0x100 or var_msg == 0x101 then
            if wparam == vkeys.VK_ESCAPE and renderWindow[0] and not isPauseMenuActive() then
                consumeWindowMessage(true, false)
                renderWindow[0] = false
            end
        end
    end)
    while true do
        wait(0)
        if update_state then
            downloadUrlToFile(script_url, script_path, function(id, status)
                if status == dlstatus.STATUS_ENDDOWNLOADDATA then
                    msg("Script updated successfully!", "good")
                    thisScript():reload()
                end
            end)
            break
        end
        if config.additional.servertime then 
            local getTime = os.time() + servernoe
            local renderTime = os.date("%H:%M:%S", getTime)
            if changePos then
            showCursor(true)
            local cX, cY = getCursorPos()
            renderFontDrawText(renderTimeFont, renderTime, cX, cY, 0xFFFFFFFF, false)
            if isKeyJustPressed(vkeys.VK_LBUTTON) then
                config.additional.timeX = cX
                config.additional.timeY = cY 
                changePos = false
                msg("Расположение времени сохранено", "good")
                showCursor(false)
            end
            else
            renderFontDrawText(renderTimeFont, renderTime, config.additional.timeX, config.additional.timeY, colorOfTime, false)
            end
        end
        if config.additional.anothertime then
            getTime = os.time() + servernoe
            sampTextdrawCreate(223, os.date("%H:%M:%S", getTime), 290, 100)
            sampTextdrawSetLetterSizeAndColor(223, 0.5, 2.2, 0xFFffffff)
            sampTextdrawSetOutlineColor(223, 0.5, 0xFF000000)
            sampTextdrawSetAlign(223, 1)
            sampTextdrawSetStyle(223, 2)
        else
            if sampTextdrawIsExists(223) then sampTextdrawDelete(223) end
        end
        local result, button, list, input = sampHasDialogRespond(8812)
        if result then
            if button == 1 then
                if input == captcha..'0' then msg(string.format('{ffffff}Right code [%.3f]', os.clock() - captime), "good")
                    config.captcha.vcode = config.captcha.vcode + 1
                    if os.clock() - captime < config.captcha.record or config.captcha.record == 0 then
                        config.captcha.record = floorStep(os.clock() - captime, 0.001)
                        msg('New record: '..goodcolor..''..config.captcha.record..' {ffffff}sec!', "bad")
                    end
                elseif input ~= captcha..'0' then msg(string.format('{ffffff}Wrong code! [%.3f] ('..captcha..'0|'..input..')', os.clock() - captime), "bad")
                    config.captcha.ncode = config.captcha.ncode + 1 
                end

            end
            removeTextdraws()
        end
    end
end

function ev.onShowDialog(id, style, title, b1, b2, text)
    if title:find("Проверка на робота") then
        did = id
        start = os.clock()
    end
    if string.match(text, "Текущее время") and config.additional.servertime then -- by valerii kalashnikov
		chislo, mesyac, god = string.match(text, "Сегодняшняя дата: 	{2EA42E}(%d+):(%d+):(%d+)")
		chas, minuti, sekundi = string.match(text, "Текущее время: 	{345690}(%d+):(%d+):(%d+)")
		datetime = {year = god,month = mesyac,day = chislo,hour = chas,min = minuti,sec = sekundi}
		servernoe = tostring(os.time(datetime)) - os.time()
	end
end

function ev.onSendDialogResponse(id, but, lis, input)
    if id == did then
        time = os.clock() - start
        time1 = string.format("%.3f", time)
        if config.main.timer and time ~= nil then
            msg('You entered captcha: '.. goodcolor ..'['..input..']{FFFFFF}, time: '.. goodcolor ..'['..time1..']{FFFFFF}', "good")
        end
    end
end

